import React from 'react';
import ParticlesComponent from '../../components/Particles';
import './index.css';




function App() {

  return (

    <div >
      <div className="container">
        <div className="title logo-text">
          <h1>Zuby.io</h1>
        </div>
      </div>
      <div className="skills has-text-centered">
        <h2 className="title has-text-weight-bold"><strong>Passion | Excellence | Determination | Innovation</strong></h2>
      </div>
      <div className='centered'>

        <div className="item button-pulse">
          <div className="button__wrapper">
            <div className="pulsing"></div>
            <button classNam="button">Click Me!</button>
          </div>

        </div>
      </div>
      <div className="bg">
        <ParticlesComponent />
      </div>



      <div >

      </div>
    </div>
  );
}

export default App;
